import React from "react";
import { StyleSheet, Text, View } from "react-native";


export default function EmployerSignUp() {
    return (
        <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
            <Text>
                This is the Employer SignUp Page!
            </Text>
        </View>
    )
}



